import {BrowserRouter as Router, Route} from 'react-router-dom';

import Login from './components/pages/Auth/Login'
import Register from './components/pages/Auth/Register'
import Home from './components/pages/Home'

function App() {
  return (
    <Router>
          <Route path="/login">
              <Login />
          </Route>
          <Route path="/register">
              <Register />
          </Route>
          <Route path="/">
              <Home />
          </Route>
    </Router>
  );
}

export default App;
